// custom
// hero section
  // variable 
  $(document).ready(function () {
    var VIDEO_PLAYING_STATE = {
      "PLAYING": "PLAYING",
      "PAUSE": "PAUSE"
    }
    var videoPlayStatus = VIDEO_PLAYING_STATE.PAUSE;
    var timeout = null;
    var waiting = 9000;
  
    var slidesCount = $('.swiper-container .swiper-slide').length;
  
    // Check if there is only one slide and hide the swiper container
    if (slidesCount <= 1) {
        $('.swiper-pagination, .swiper-button-next, .swiper-button-prev').hide();
    } else {
      var swiper = new Swiper('.swiper-container', {
        navigation: {
          nextEl: '.swiper-button-next',
          prevEl: '.swiper-button-prev',
        },
        lazy: true,
        loop: true,
        parallax: true,
        speed: 600,
        effect: "fade",
        pagination: {
          el: ".swiper-pagination",
          clickable: true,
        },
      });
    }
  
  
  // HTML5 vdo object
  var options = {};
  var player = videojs('my-player', options);
  player.on('ended', function() {
    next()
  })
  
  // swiper object
  swiper.on('slideChangeTransitionEnd', function () {
    var index = swiper.activeIndex
    var currentSlide =   $(swiper.slides[index])
    var currentSlideType = currentSlide.data('slide-type')
    
    // incase user click next before video ended
    if (videoPlayStatus === VIDEO_PLAYING_STATE.PLAYING) {
      player.pause()
    }
    
    clearTimeout(timeout)
    
    switch (currentSlideType) {
      case 'img':
        runNext()
        break;
      case 'vdo':
        player.currentTime(0)
        player.play()
        videoPlayStatus = VIDEO_PLAYING_STATE.PLAYING
        break;
      default:
        throw new Error('invalid slide type');
    }
  })
  
  // global function
  function prev() {
    swiper.slidePrev();
  }
  
  function next() {
    swiper.slideNext();
  }
  
  function runNext() {  
    timeout = setTimeout(function () {
      next()
    }, waiting)
  }
  
  runNext()
});
//   end hero section
// select2
$(document).ready(function() {
    $('.uk-select-search').select2();
});

// Expedition Trekking booking
$(document).ready(function() {
    //after load will check the checkbox is checked or not
    var check = $("#Expedition").prop("checked");
    if (check) {
        $("#one").addClass("uk-display-block");
    }

    //click on yes
    $("#Expedition").on("click", function() {
        check = $(this).prop("checked");
        $("#two").removeClass("uk-display-block");
        $("#one").addClass("uk-display-block");

    })
    //click on No
    $("#Trekking").on("click", function() {
        check = $(this).prop("checked");
        $("#one").removeClass("uk-display-block");
        $("#two").addClass("uk-display-block");
        console.log(check);
    })
});

//  counter
$('.count').each(function() {
    $(this).prop('Counter', 0).animate({
        Counter: $(this).text()
    }, {
        duration: 3000,
        easing: 'swing',
        step: function(now) {
            $(this).text(Math.ceil(now));
        }
    });
});

// back to top
var btn = $('#BackToTop');

$(window).scroll(function() {
    if ($(window).scrollTop() > 500) {
        btn.addClass('show');
    } else {
        btn.removeClass('show');
    }
});


