// read more              

readMore($('.uk-spoiler'), 10);

function readMore(jObj, lineNum) {
    if (isNaN(lineNum)) {
        lineNum = 10;
    }
    var go = new ReadMore(jObj, lineNum);
}

//class
function ReadMore(_jObj, lineNum) {
    var READ_MORE_LABEL = 'Read More +';
    var HIDE_LABEL = 'Read Less -';

    var jObj = _jObj;
    var textMinHeight = '' + (parseInt(jObj.children('.uk-show-more').css('line-height'), 10) * lineNum) + 'px';
    var textMaxHeight = '' + jObj.children('.uk-show-more').css('height');

    jObj.children('.uk-show-more').css('height', '' + textMaxHeight);
    jObj.children('.uk-show-more').css('transition', 'height .5s');
    jObj.children('.uk-show-more').css('height', '' + textMinHeight);

    jObj.append('<button class="read-more uk-button uk-button-primary-bordered">' + READ_MORE_LABEL + '</button>');

    jObj.children('.read-more').click(function() {
        if (jObj.children('.uk-show-more').css('height') === textMinHeight) {
            jObj.children('.uk-show-more').css('height', '' + textMaxHeight);
            jObj.children('.read-more').html(HIDE_LABEL).addClass('active');
        } else {
            jObj.children('.uk-show-more').css('height', '' + textMinHeight);
            jObj.children('.read-more').html(READ_MORE_LABEL).removeClass('active');
        }
    });

}


